import React from 'react';
import './App.css';

class App extends React.Component {
  render(){
    const numbers = [1,1,3,4,5]
    return (
      <div className="App">
        <h1>Trabajando con Listas</h1>
        {numbers.map(number => {
          return <p key={number}>Soy el numero {number}</p>
        })
        }
      </div>
    );
  }
}

export default App;
